function insertRootDiv() {
    var rootDiv = document.createElement("div");
    rootDiv.id = "xninja-root";
    rootDiv.innerHTML = "XNinja loading...";
    document.body.insertBefore(rootDiv, document.body.firstChild);
};

insertRootDiv();
